import * as React from 'react'
import { Box, Avatar, Collapse, Grid, Button, IconButton, Table, TableBody, TableCell,
  TableContainer, TableHead, TableRow, Typography, Paper } from '@mui/material'
/* icons */
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown'
import KeyboardArrowUpIcon from '@mui/icons-material/KeyboardArrowUp'
import VisibilityIcon from '@mui/icons-material/Visibility'
import ClearIcon from '@mui/icons-material/Clear';

function createData(
  image: string,
  name: string,
  lieu: string,
  description: string,
  price: string,
  dateStart: string,
  dateEnd: string
) {
  return {
    image,
    name,
    lieu,
    description,
    price,
    dateStart,
    dateEnd,
    history: [
      {
        caracteristique: 'surface',
        value: '55 m^2', 
      },
      {
        caracteristique: 'nombre de pièces',
        value: '3',
      },
    ],
  }
}

function Row(props: { row: ReturnType<typeof createData> }) {
  const { row } = props
  const [open, setOpen] = React.useState(false)

  return (
    <React.Fragment>
      <TableRow sx={{ '& > *': { borderBottom: 'unset' } }}>
        <TableCell>
          <IconButton aria-label="expand row" size="small" onClick={() => setOpen(!open)}>
            {open ? <KeyboardArrowUpIcon /> : <KeyboardArrowDownIcon />}
          </IconButton>
        </TableCell>
        <TableCell component="th" scope="row" sx={{ display: 'flex', flexDirection: 'row' }}>
          <Avatar variant="rounded" src={row.image} sx={{ objectFit: 'cover', mr: 2 }}></Avatar>
          <Typography>{row.lieu}</Typography>
        </TableCell>
        <TableCell>
          <Typography>{row.name}</Typography>
          </TableCell>
        <TableCell>
          {row.price}
        </TableCell>
        <TableCell>
          du {row.dateStart}<br></br>au {row.dateEnd}
        </TableCell>
        <TableCell>
          <Grid container>
            <Grid xs={12} sm={2} sx={{ mx: 'auto' }}>
              <Button
                type="submit"
                fullWidth
                variant="contained"
              >
                <VisibilityIcon/>
              </Button>
            </Grid>
              <Grid xs={12} sm={2} sx={{ mx: 'auto' }}>
                <Button
                  type="submit"
                  fullWidth
                  variant="contained"
                >
                  <ClearIcon/>
                </Button>
              </Grid>
          </Grid>
        </TableCell>
      </TableRow>
      <TableRow>
        <TableCell style={{ paddingBottom: 0, paddingTop: 0 }} colSpan={6}>
          <Collapse in={open} timeout="auto" unmountOnExit>
            <Box sx={{ margin: 1 }}>
              <Typography variant="h6" gutterBottom component="div">
                Détails
              </Typography>
              <Table size="small" aria-label="purchases">
                <TableHead>
                  <TableRow>
                    <TableCell>Caractéristiques</TableCell>
                    <TableCell></TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {row.history.map((historyRow) => (
                    <TableRow key={historyRow.caracteristique}>
                      <TableCell component="th" scope="row">
                        {historyRow.caracteristique}
                      </TableCell>
                      <TableCell>{historyRow.value}</TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </Box>
          </Collapse>
        </TableCell>
      </TableRow>
    </React.Fragment>
  )
}

